import React from 'react';
import ReactDOM from 'react-dom';
//import './index.css';
//import App from './App';
//import * as serviceWorker from './serviceWorker';

const Hello = (props) => {
  return (
    <div>
      <p>Hello {props.name} you are {props.age} years old</p>
    </div>
  )
}

const Footer = () => {
  return (
    <div>
      greeting app created by <a href="https://github.com/wongyiyeung">wongyiyeung</a>
    </div>
  )
}

const App = () => {
  const now = Date();
  const name = "Peter";
  const age = 20;
  return (
   <div>
      <h1>Greetings</h1>
      <Hello name="Maya" age={26 + 10}/>
      <Hello name={name} age={age}/>
      <Footer />
   </div>
  )
}

ReactDOM.render(
  <App />,
  document.getElementById('root')
);

